import React, { useState } from 'react';
import './HomeUser1.css';

const HomeUser1 = () => {
  const [isOpen, setIsOpen] = useState("none");
  const [isOpen1, setIsOpen1] = useState(false); // Changed to `true` to show the element initially

  const handleToggle = () => {
    setIsOpen(prevIsOpen => (prevIsOpen === "block" ? "block" : "none"));
    setIsOpen1(prevIsOpen1 => !prevIsOpen1);
  };

  console.log(isOpen, isOpen1);

  return (
    <div className='Container-Screen-Shoot'>
      <div className='Screen'>
     
        <div className='banner-top' style={{ display: isOpen }}></div>
        <div className='banner' onClick={handleToggle}>
         windows
        </div>
      </div>
    </div>
  );
};

export default HomeUser1;
